import axios from "axios";

 export default{
    createGame: (gameName) => {
        // console.log("Running the browser");
        return axios.post("/api/newgame", {gameName: gameName})
    },
    pullGame: (gameID) => {
        // axios.post("/api/pullgame/", {_id: gameID})
        axios.get("/api/pullgame/" + decodeURIComponent(gameID))
        .then(result => {
            // console.log(result.data.gameName);
            return result.data.gameName;
        });
    }
 };//END export default
